export default function projectReducer(state = defaultState, action) {
  switch (action.type) {
    case SET_PROJECT_DATA:
      return {...state, data: action.payload}
    default:
      return state
  }
}

export const setProject = (data) => ({type: SET_PROJECT_DATA, payload: data})